import React, { Component } from "react"

export default function ToDo(props) {
    const deleteItems = () => {
        console.log("Deleted")
    }
    return (
        <>
            <div className="todo_style">
                <i
                    className="fa fa-times"
                    aria-hidden="true"
                    onClick={deleteItems}
                />
                <li>{props.text}</li>
            </div>
        </>
    )
}
